            "id": 1713245591413,
            "content": "# 区别\n1.**存储时间**: \n- cookie数据始终在同源的http请求中携带(即使不需要)，即会在浏览器和服务器间来回传递。\n- sessionStorage数据只在当前会话期间有效，关闭浏览器或窗口猴数据会被清除。\n- localStorage数据没有过期时间，会被永久保存，除非手动删除。\n\n2.**存储大小**:\n\n- cookie数据大小不能超过4k。\n- sessionStorage和localStorage虽然也有存储大小限制，但比cookie大得多，可以达到5M或更大。\n\n3.**存储内容**:\n- cookie中只能保管ASCII字符串，并始终通过http传输。\n- sessionStorage和localStorage中能够保存包括中文在内的任意字符串对象。\n\n# 关于token的使用\n\n## 将Token存储在Cookie中\n### 优势：\n- 自动发送：当浏览器向同一域发送请求时，cookie会自动附加到请求中，这样就不需要每次请求都手动设置Authorization头部。\n- 持久性: 除非设置了过期时间，否则cookie会在浏览器会话期间持续存在，这对于需要长时间认证的应用来说是有用的。\n- 同源策略： 默认情况下，cookie仅发送给设置它们的源，这有助于防止跨站请求伪造（CSRF）攻击。\n### 劣势：\n- 安全性：虽然可以设置HttpOnly和Secure标志来增加安全性，但cookie仍然可能受到跨站脚本攻击（XSS）的影响，因为攻击者可能够读取或篡改cookie。\n- 大小限制： cookie的大小通常有限制，这可能限制了token的大小。\n\n## 直接将Token放在请求中\n### 优势：\n- 安全性： 与将token存储在cookie中相比，将token放在请求头部中可能更安全，特别是当使用https时。这是因为攻击者不能通过单独去浏览器存储的cookie来窃取token。\n- 灵活性： 你可以更灵活地控制token的传递，例如只在需要时才包括token，或者根据不同的请求类型选择不同大的认证机制。\n- 无大小限制： 与cookie相比，请求头部通常没有大小限制，因此你可以存储更大的token。\n### 劣势：\n- 手动管理： 你需要再每个需要认证的请求中手动设置Authorization头部，这可能会增加开发的复杂性。\n- 易错性： 如果忘记在某个请求中包含token，那么该请求可能会失败或被拒绝。\n\n\n\n",
            "title": "cookie、localStorage 和 sessionStorage",
            "update": "2024/4/16 13:33:11",
