            "id": 1712905638569,
            "content": "# 防抖（Debounce）\n防抖的基本思想是，如果一个函数持续地、高频地触发，那么只在触发操作结束后，延迟一段时间后执行一次。如果在这个延迟时间内再次触发，则重新计算延迟时间。\n\n防抖常用于输入框实时搜索、按钮连续点击等场景，只有在用户停止输入或点击后，才执行相应的搜索或提交操作。\n``` js\nfunction debounce(func, wait) {\n  let timeout;\n  return function(...args) {\n    clearTimeout(timeout); // 清除上一次设置的定时器\n    timeout = setTimeout(() => func.apply(this, args), wait); // 设置新的定时器\n  };\n}\n\n// 使用示例\nconst debouncedSave = debounce(function() {\n  console.log('Saving...');\n}, 2000);\n\nwindow.addEventListener('resize', debouncedSave); // 窗口大小调整时，防抖函数会在最后一次调整后的2秒内执行一次\n```\n\n# 节流（Throttle）\n节流的基本思想是，在一段时间内只执行一次函数，即使在这段时间内函数被触发了多次。\n\n节流常用于滚动加载、鼠标移动等场景，可以限制函数在一定时间内的执行次数。\n``` js\nfunction throttle(func, delay) {\n    let lastCall = 0;\n    return function(...args) {\n        const now = new Date().getTime();\n        if (now - lastCall < delay) {\n            return;\n        }\n        lastCall = now;\n        return func.apply(this, args);\n    }\n}\n// 使用示例\nconst throttledScroll = throttle(function() {\n  console.log('Scrolling...');\n}, 1000);\n\nwindow.addEventListener('scroll', throttledScroll); // 滚动时，节流函数会在每次滚动后1秒内最多执行一次\n```",
            "title": "防抖和节流",
