            "id": 1682561260204,
            "content": "# 题目要求\n最近遇到了一个 JavaScript 手写代码题，要求实现一个具有并发数量限制的异步任务调度器，可以规定最大同时运行的任务。\n\n实现一个Scheduler类，使下面的代码能正确输出。\n``` js\n// 延迟函数\nconst sleep = time => new Promise(resolve => setTimeout(resolve, time));\n\n// 同时进行的任务最多2个\nconst scheduler = new Scheduler(2);\n\n// 添加异步任务\n// time: 任务执行的时间\n// val: 参数\nconst addTask = (time, val) => {\n    scheduler.add(() => {\n        return sleep(time).then(() => console.log(val));\n    });\n};\n\naddTask(1000, '1');\naddTask(500, '2');\naddTask(300, '3');\naddTask(400, '4');\n// 2\n// 3\n// 1\n// 4\n```\n\n# 思路及实现\n设计Scheduler类，要具有并发数量限制功能，需要定义最大可并发任务数max，从入参中获取。并定义当前并发任务数count，表示正在执行的任务数量。另外，定义一个待执行的任务队列queue。\n\n在添加任务add函数中，首先判断当前正在执行的任务数，若当前正在执行的任务数达到最大容量max，则当前的任务需要阻塞在此处。具体做法为，new一个Promise对象，将resolve函数的引用推入队列queue中。只要resolve函数没有被执行，当前任务就会一直阻塞在这里。\n\n若当前正在执行的任务数没有达到最大容量，那么对count进行加一，执行当前函数fn，并拿到返回值res，执行完毕后count减一。此时若队列queue中有值，说明之前有任务因为并发数量限制而被阻塞，将队头的resolve弹出，并执行。执行resolve之后，之前阻塞的任务就可以正常执行了。\n\n最后返回fn函数执行的结果res。\n\n具体代码如下：\n``` js\nclass Scheduler {\n    constructor(max) {\n        // 最大可并发任务数\n        this.max = max;\n        // 当前并发任务数\n        this.count = 0;\n        // 阻塞的任务队列\n        this.queue = [];\n    }\n\n    async add(fn) {\n        if (this.count >= this.max) {\n            // 若当前正在执行的任务，达到最大容量max\n            // 阻塞在此处，等待前面的任务执行完毕后将resolve弹出并执行\n            await new Promise(resolve => this.queue.push(resolve));\n        }\n        // 当前并发任务数++\n        this.count++;\n        // 使用await执行此函数\n        const res = await fn();\n        // 执行完毕，当前并发任务数--\n        this.count--;\n        // 若队列中有值，将其resolve弹出，并执行\n        // 以便阻塞的任务，可以正常执行\n        this.queue.length && this.queue.shift()();\n        // 返回函数执行的结果\n        return res;\n    }\n}\n测试\nclass Scheduler {\n    ...\n}\n\nconst sleep = time => new Promise(resolve => setTimeout(resolve, time));\n\nconst scheduler = new Scheduler(2);\n\nconst addTask = (time, val) => {\n    scheduler.add(() => {\n        return sleep(time).then(() => console.log(val));\n    });\n};\n\naddTask(1000, '1');\naddTask(500, '2');\naddTask(300, '3');\naddTask(400, '4');\n// 2\n// 3\n// 1\n// 4\n```\n\n如上代码所示，并发任务数量最大为2。添加了4个异步任务，所需要执行的时间分别为1000 ms、500 ms、300 ms、400 ms。\n\n由于并发任务数量最大为2，最初执行任务1和2。任务2经过500 ms后执行完毕，输出'2'。接着执行任务3，又经过300 ms后，输出'3'。任务1仍然在执行，任务4开始执行。到了1000 ms时刻，任务1执行完毕，输出'1'。最后任务4执行完，输出'4'。\n\n符合并发数量限制，达到了设计要求。",
            "title": "JavaScript 实现异步任务调度器",
            "update": "2023/4/27 10:07:40",
            "tags": "javascript"
